import React from 'react';
import { Route, Switch } from 'react-router-dom';
import './App.css';
import Stafflogin from './component/Stafflogin/Stafflogin';
import Navbar from './component/Header/Navbar';
import Footer from './component/Footer/Footer';
import FinalAddCoupon from './component/Coupon/FinalAddCoupon.component';
import FinalAddMenuItem from './component/Coupon/FinalAddMenuItem.component';
import FinalAddPincode from './component/Coupon/FinalAddPincode.component';

import axios from "axios";


// axios.defaults.headers.common['Authorization'] = localStorage.getItem('token');

const App = () => {

  return (

    <Switch>

        <Route exact path="/stafflogin" component={Stafflogin} />
        <div>
          <Navbar />
          <Stafflogin />
          <Footer />
        </div>

    </Switch>
  )
}

export default App;
